class Solution {
    func getGoodIndices(_ variables: [[Int]], _ target: Int) -> [Int] {
        var result: [Int] = []
        for i in 0..<variables.count {
            let v = variables[i]
            let a = v[0], b = v[1], c = v[2], m = v[3]
            if (((a * b) % 10).power(c, modulo: m)) == target {
                result.append(i)
            }
        }
        return result
    }
}

extension Int {
    func power(_ exponent: Int, modulo: Int) -> Int {
        var ans = 1
        var base = self % modulo
        var exp = exponent
        while exp > 0 {
            if exp % 2 == 1 {
                ans = (ans * base) % modulo
            }
            base = (base * base) % modulo
            exp /= 2
        }
        return ans
    }
}
